              Praesent commodo cursus magna, vel scelerisque nisl consectetur.
            </p>
            <a href="#about" class="btn btn-primary">Read More</a>

          </Carousel.Caption>

        </div>
      </Carousel  >

    </div >
  );
};

export default Slideshow;
